import Header from './common/header/index';
import { Provider } from 'react-redux';
import {BrowserHistory, Router} from 'react-router-dom';
import store from './store';

function App() {
  return (
    <Provider store={store}>
       <Header/>
       <BrowserHistory>
        <Router path='/' render={() => <home></home>}></Router>
       </BrowserHistory>
    </Provider>
  );
}

export default App;
